drop table config_Types cascade constraints; 
drop table config_Version cascade constraints;
drop table config_Registers cascade constraints;
drop table config_Status cascade constraints;
DROP SEQUENCE CT_ID_seq;
DROP SEQUENCE CV_ID_seq; 
DROP SEQUENCE CR_ID_seq; 
DROP SEQUENCE CS_ID_seq; 
/

CREATE TABLE config_Types 
(  config_ID NUMBER PRIMARY KEY, 
   config_Type VARCHAR(100) 
);
create sequence CT_ID_seq;

create or replace trigger trg_CT_id
     before insert on config_Types
     for each row
   begin
     select CT_ID_seq.nextval
       into :new.config_ID
       from dual;
   end;
/
CREATE TABLE config_Version
(  CV_ID NUMBER PRIMARY KEY,
   config_ID NUMBER NOT NULL,
   version_Number DECIMAL
);
create sequence CV_ID_seq;

create or replace trigger trg_CV_id
     before insert on config_Version
     for each row
   begin
     select CV_ID_seq.nextval
       into :new.CV_ID
       from dual;
   end;
 /
CREATE TABLE config_Registers
(  CR_ID NUMBER PRIMARY KEY,
   config_ID NUMBER NOT NULL,
   version_Number DECIMAL,
   odd_even VARCHAR(30) NOT NULL,
   chan_Addr VARCHAR(30) NOT NULL,
   reg_Addr VARCHAR(30) NOT NULL,
   data_value VARCHAR(30) NOT NULL
);
create sequence CR_ID_seq;

create or replace trigger trg_CR_id
     before insert on config_Registers
     for each row
   begin
     select CR_ID_seq.nextval
       into :new.CR_ID
       from dual;
   end;
/
CREATE TABLE config_Status
(  CS_ID NUMBER PRIMARY KEY,
   time_Stamp timestamp DEFAULT CURRENT_TIMESTAMP,
   station_Number INT NOT NULL,
   config_ID NUMBER NOT NULL,
   version_Number DECIMAL,
   success char(1) check (success in ('Y','N'))
);
create sequence CS_ID_seq;

create or replace trigger trg_CS_id
     before insert on config_Status
     for each row
   begin
     select CS_ID_seq.nextval
       into :new.CS_ID
       from dual;
   end;
  /






 






                                                                                                                                                 


                                                                            


                                                                                                                                                           

                                                                              
